pragma solidity ^0.4.24;

import "../lib/ENS.sol";
import "../lib/Ownable.sol";

/**
 * @title The KomgoRegistrar contract
 * @author Edson Alcala
 * @notice This contract registers all the domains and subdomains of Komgo 
*/
contract KomgoRegistrar is Ownable{
    ENS ens;

    bytes32 public rootDomain;
    bytes32 public metaDomain;

    constructor(address _ensAddr, bytes32 _node, bytes32 _meta) public {
        ens = ENS(_ensAddr);
        rootDomain = _node;
        metaDomain = _meta;
    }

    /**
     * @dev It receives a subdomain and call the ENS registry to set the subNodeOwner
     */
    function registerTest2(bytes32 _subDomain, address _nodeOwner) public onlyOwner {
        ens.setSubnodeOwner(rootDomain, _subDomain, _nodeOwner);
        ens.setSubnodeOwner(metaDomain, _subDomain, owner);
    }
}

